var telSelector = document.querySelector('input[type="tel"]');
var inputMask = new Inputmask('+7 (9 9 9) 9 9 9-9 9-9 9');
inputMask.mask(telSelector);
modalButtonOpen.addEventListener('click', function () {
  modal.classList.add('active');
  body.classList.add('noscroll');
  modalWrap.classList.add('active');
});
modal.addEventListener('click', function (e) {
  var isModal = e.target.closest('.modal__wrap');

  if (!isModal) {
    modal.classList.remove('active');
    body.classList.remove('noscroll');
  }
});
modalButtonClose.addEventListener('click', function () {
  modal.classList.remove('active');
  body.classList.remove('noscroll');
});
modalButtonCloseThanks.addEventListener('click', function () {
  modal.classList.remove('active');
  body.classList.remove('noscroll');
  modalThanks.classList.remove('active');
  modalWrap.classList.remove('noscroll');
});
var validation = new JustValidate('.modal__form');
validation.addField('#phone', [{
  rule: 'required',
  value: true,
  errorMessage: 'Введите номер телефона!'
}, {
  rule: 'function',
  validator: function validator() {
    var phone = telSelector.inputmask.unmaskedvalue();
    return phone.length === 10;
  },
  errorMessage: 'Введите корректрый номер телефона!'
}]).onSuccess(function (e) {
  if (document.querySelector('#checkbox').checked) {
    modalWrap.classList.remove('active');
    body.classList.remove('noscroll');
    modalThanks.classList.add('active');
  } else {
    var check = document.querySelector('.label-link');

    var _block = document.createElement('div');

    _block.className = "check";
    _block.innerHTML = "Вы должны согласиться с условиями";
    check.after(_block);
  }
});
var btnSmall = document.querySelector('.benefits-small__button');
var block = document.querySelector('.benefits__list');
var smallBlock = document.querySelector('.benefits-small');
var btn = document.querySelector('.benefits__list-button');
btnSmall.addEventListener('click', function () {
  block.classList.add('active');
  smallBlock.classList.add('none');
});
btn.addEventListener('click', function () {
  block.classList.remove('active');
  smallBlock.classList.remove('none');
});
var hamburger = document.querySelector('.hamburger');
var menuMobale = document.querySelector('.mobail__nav');
